Defendant Tyniesha S Jackson in court with attorney Tedia K. Gamino.  Kevin M. Osborne appeared for the State of Wisconsin.  The Defendant enters a plea of no contest to count #2.  The Court finds the Defendant guilty.  Count #3 is dismissed and read in.     The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

30 DAYS JAIL;

TERM OF PROBATION:  12 MONTHS; Probation may be transferred to Milwaukee County if accepted;

CONDITIONS OF PROBATION:  
*No contact with:  co-defendant or any Woodman's Store;
*Attend Criminal Thinking Class;
*Attend Retail Theft Class at UW Milwaukee;

COURT COSTS:  $243.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation); Defendant to provide DNA sample, if not yet provided,   immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

Expunction is conditionally granted upon verification of completion of sentence, payment of all costs/fees and no new criminal law violations.
